import React, { Component } from 'react'

let buttonStyle = {
  margin: '10px 10px 10px 0'
};


const Button = props => {

  return (
      <button 
        className={props.className}
        onClick={props.onClick}
        disabled={props.disabled}
      >
        {props.children}  
      </button>
    );
}

export default Button
